// App.jsx
import React from 'react';

const App = () => {
  // Simula los datos directamente en el componente
  const data = [
    {
      ean: 'EAN1',
      nombre_producto: 'Producto 1',
      sku: 'SKU1',
      market: 'Market1',
      rango_precios: '100.0 - 120.0',
    },
    {
      ean: 'EAN2',
      nombre_producto: 'Producto 2',
      sku: 'SKU2',
      market: 'Market2',
      rango_precios: '130.0 - 150.0',
    },
    // Puedes agregar más objetos según sea necesario
  ];

  return (
    <div>
      {/* Renderiza tus componentes HTML utilizando 'data' */}
      {data.map(item => (
        <div key={item.ean}>
          <p>{item.nombre_producto}</p>
          <p>{item.ean}</p>
          <p>{item.sku}</p>
          <p>{item.market}</p>
          <p>{item.rango_precios}</p>
        </div>
      ))}
    </div>
  );
};

export default App;
